â€œMy aunt Eleelee and Bootron got me started. They used to take me to practices, dance shows and parades when I was little. That's where I began to love the culture. Once I got old enough to do everything by myself, I joined a group called Terra Squad Footwork Company. I wanted to learn more from the one and only Aaron "AG" Neal, who started the group. I also took classes with The Era Footwork Crew. They helped me to engage with this dance culture that I love. I volunteered to help with their show IN THE WURKZ, as well. During my footwork journey, I met a lot of awesome choreographers, producers, and dancers. I hope that I can take my footwork journey and make it into a career for myself. What's better than finding a career where you get do what you love?" 

Tricey continues to footwork with Terra Squad in Chicago, and she appears briefly in a new music video called "Footwerk" by Keith Harris, drummer of the Black Eyed Peas.
